export const selectorOptions = {
  buttons: [
    {
      step: 'day',
      stepmode: 'backward',
      count: 1,
      label: '1 Day',
    },
    {
      step: 'day',
      stepmode: 'backward',
      count: 7,
      label: '1 Week',
    },
    {
      step: 'day',
      stepmode: 'backward',
      count: 14,
      label: '2 Weeks',
    },
    {
      step: 'month',
      stepmode: 'backward',
      count: 1,
      label: '1 Month',
    },
    {
      step: 'month',
      stepmode: 'backward',
      count: 3,
      label: '3 Months',
    },
    {
      step: 'month',
      stepmode: 'backward',
      count: 6,
      label: '6 Months',
    },
    {
      step: 'year',
      stepmode: 'backward',
      count: 1,
      label: '1 Year',
    },
    {
      step: 'year',
      stepmode: 'backward',
      count: 2,
      label: '2 Years',
    },
    {
      step: 'all',
      label: 'default',
    },
  ],
};
